package bean;

public class adminDNbean {
	private String tendn;
	private String mk;
	public adminDNbean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public adminDNbean(String tendn, String mk) {
		super();
		this.tendn = tendn;
		this.mk = mk;
	}
	public String getTendn() {
		return tendn;
	}
	public void setTendn(String tendn) {
		this.tendn = tendn;
	}
	public String getMk() {
		return mk;
	}
	public void setMk(String mk) {
		this.mk = mk;
	}
	
	
}
